import './App.css';

import Header from "./pages/include/header.js";
import Footer from "./pages/include/footer.js";
import RightMenu from "./pages/include/right_menu.js";


const App = () => {


  return (

    <div className="App">
      <Header />
      <div className="banner-sec">
          <div className="banner-tit">타이틀입니다.</div>
      </div>
      <div className="wrap">
          <body className="app-body">
            <div className="cnt_wrap">
            asd<br/>asd<br/>asd<br/>asd<br/>asd<br/>asd<br/>asd<br/>asd<br/>asd<br/>asd<br/>asd<br/>asd<br/>asd<br/>asd<br/>asd<br/>asd<br/>asd<br/>asd<br/>asd<br/>asd<br/>asd<br/>asd<br/>asd<br/>asd<br/>asd<br/>asd<br/>asd<br/>asd<br/>asd<br/>asd<br/>asd<br/>asd<br/>asd<br/>asd<br/>asd<br/>asd<br/>asd<br/>asd<br/>asd<br/>asd<br/>asd<br/>asd<br/>asd<br/>asd<br/>asd<br/>asd<br/>asd<br/>asd<br/>asd<br/>
            </div>
            <RightMenu />
          </body>
      </div>


      <Footer />

    </div>
  );
};

export default App;
